import { Component } from '@angular/core';
import { Fumo } from "./fumo.model";

@Component({
  selector: 'app-root',
  templateUrl: './app.component.html',
  styleUrls: ['./app.component.scss']
})
export class AppComponent {
  fumoProducts: Fumo[] = [
    {
      name : "Yuyuko",
      price : 60,
      image : "./assets/images/yuyukoFumo.jpg"
    },
    {
      name : "Cirno",
      price : 60,
      image : "./assets/images/cirnoFumo.jpg"
    },
    {
      name : "Reimu",
      price : 60,
      image : "./assets/images/reimuFumo.jpg"
    },
    {
      name : "Marisa",
      price : 60,
      image : "./assets/images/marisaFumo.jpg"
    },
    {
      name : "Scarlet",
      price : 60,
      image : "./assets/images/scarletFumo.jpg"
    }
  ];
}
<h1>ngFor With Complex Objects</h1>

<h2>Fumo List</h2>

<div *ngFor="let fumo of fumoProducts">
  <h3>{{ fumo.name }}</h3>
  <span>{{ fumo.price }}</span>
  <img [src]="fumo.image" height="200px" alt={{fumo.name}}>
</div>
